import React from 'react';
import Header from './Components/Header';
import '../CSS/Homepage.css'

const Homepage = () => {
  const { toggleSidebar, sidebarClassName } = this.state;

  return (
    <React.Fragment>
      <Header toggleSidebar={this.toggleSidebar} sidebarClassName={sidebarClassName} />
      <main>Homepage</main>
    </React.Fragment>
  );
};

export default Homepage;
